import React from "react";
import Group from "./group/group";

export default function Groups({ groups }) {
  return (
    <ul>
      {groups.map((group, index) => {
        return (
          <Group group={group} index={index} key={`group-group-${index}`} />
        );
      })}
    </ul>
  );
}
